script: |
  super -f text -I q9510.spq | sort > q9510.out

inputs:
  - name: q9510.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 NOT IN ( 13 + - 63 + - col0 * + col0, - ( col1 ), - ( + col2 ) * + + col2, - - col0 / 6, 26, - col2 + + - col0 );
  - name: tab2

outputs:
  - name: q9510.out
    data: |
      46	51	23
      64	77	40
      75	67	58
